import Vue from 'vue';
import App from './App.vue'; // antar att din huvudkomponent heter App.vue
import router from './router'; // importera din router från filen där du definierade den

Vue.config.productionTip = false;

new Vue({
    router, // lägg till routern i Vue-instansen
    render: h => h(App)
}).$mount('#app');
